	--[[ El proyecto Kara Effector es una serie de archivos .lua que juntos tienen la capacidad de implementar efectos prediseñados
	de Karaoke, efectos de Edición, también de Líneas de Traducción y muchas opciones más.  Además nos brinda la opción de poderlos
	modificar o de crear nuevos Efectos desde ceros o tomando como base algún otro efecto ya hecho, si así se desea.
	El Kara Effector está dotado de amplias librerías que permiten ejecutar los efectos que tiene por Default o lo nuevos creados y
	también crear nuevas, múltiples y creativas combinaciones.  La mayor parte de las combinaciones de Efectos y Funciones internas
	del Kara Effector son capaces de realizar o emular casi cualquier tipo de efecto, y además posee una amplia variedad de figuras
	ASSdraw (Shapes) para los efectos que así lo requieran.
	El uso del Kara Effector es totalmente libre, y si quieren, pueden colocar los respectivos créditos en sus proyectos, del autor
	y/o colaboradores del Effector. Se pueden comunicar conmigo https://www.facebook.com/itachi.2021 en el caso de que tengan dudas
	o de que quieran dar alguna sugerencia o aporte, o por qué no, hacer parte del proyecto.
	Deseamos que el Kara Effector les sea de gran utilidad y les sirva de punto de partida para que cada uno de ustedes pueda hacer
	libremente sus propios efectos y lograr combinaciones que sean usadas cuando necesiten.  Recomendamos evitar cualquier forma de
	modificación en el código del Effector o de alguna de sus funciones o Librerías,  a menos que estén completamente seguros de lo
	que están haciendo,  ya que lo que más factible es que deje de funcionar de manera correcta o que simplemente no lo haga. Y sin
	más, nos despedimos, esperando que este trabajo sea del agrado de todos ustedes. ^^'... ]]--
