												if returnfx[ 1 ]:match( "\\fscx%d+[%.%d+]*" )
													or returnfx[ 1 ]:match( "\\fscy%d+[%.%d+]*" ) then
													fx.tag_size = ""
												elseif fx.tag_size == "" then
													fx.tag_size = "\\fscx100\\fscy100"
												end
											end
											if char.text ~= noblank1
												and char.text ~= noblank2 then
												if fxgroup == true
													and returnfx[ 1 ]:gsub( "%b{}", "" ) ~= ""
													and returnfx[ 1 ]:gsub( "%b{}", "" ) ~= " " then
													if fx__.modify == false
														and fx__.namefx ~= "raw" then
														l.head = headboard or format( "%s %s: %s [line origin: %s - line fx: %s] ", script_name, script_version .. script_update, fx__.effect:gsub( "%S+[%-%S+]*%[fx%]: ", "" ), ii, count_fx + 1 )
														l.text = fx.tm( format( "{%s%s%s%s%s%s%s}%s", l.head, fx.align, fx.pos, tags_style, fx.tag_size, effector.keeptags( fx__.t_type, fx__.keeptagsfx ) .. fx.add_tags, fx.Det, tag.delete_in_return( returnfx[ 1 ] ) ), istable )
														l.effect = effectboard or "Effector [fx]"
														l.layer = fx.layer
														l.actor = actorboard or actor_fx
														subs.insert( #subs + Rline, l )
														count_fx = count_fx + 1
													elseif fx__.modify == false
														and fx__.namefx == "raw" then
														l.text = fx.tm( returnfx[ 1 ] )
														subs.insert( #subs + Rline, l )
														count_fx = count_fx + 1
													else
														lines_comment = false
														line.start_time = fx.start_time
														line.end_time = fx.end_time
														line.text = fx.tm( format( "{%s}%s", fx.add_tags, returnfx[ 1 ] ) )
													end
												end
												ci = 1
											end
										end
										j = j + 1
										time_fff = tonumber( os.time( ) )
										aegisub.progress.task( format( "Lines: [%d/%d]  time: [%s]  Lines Generated: %d", count_ln, #idx_line, effector.time( time_iii, time_fff ), count_fx ) )
										aegisub.progress.set( 100 * (line.i + (char.i + j / maxj) / (char.n + j / maxj)) / (line.n + (char.i + j / maxj) / (char.n + j / maxj)) )
									end
									J = J + 1
								end
								left = left + width
								char.i = char.i + ci
								char.ii = char.ii + 1
							end
						end
					end
				end
			end
		end
