	Apotoxin_4869_Antidote = effector.create_fx( "LIfx", "Apotoxin_4869_Antidote", "Syl", true, false, "#FFFF00", "#00FFFF", "#FF00FF", "0", "0", "0", "l.start_time", "l.end_time", "", "", "", "", "syl.center", "syl.middle", "", "", "5", "0", "fx.pos_x", "fx.pos_y", "", "1", "", "syl.text", "outclip( )", "delay = 8f;\ndelay2 = 50li;\ncolors = { shape.color1, shape.color3, shape.color4 };\noutclip = function( )\n	local dx1, dx2, dy1, dy2\n	local rand_x = R( syl.width )\n	local rand_y = R( syl.height )\n	local time_ini\n	maxloop( 4 )\n	relayer( R( 0, 3 ) )\n	local Rnd = R( 2 )\n	if Rnd == 1 then\n		dx1 = fx.pos_l + syl.width * R( 0, 1 )\n		dy1 = fx.pos_t + rand_y\n		dx2 = dx1\n		dy2 = dy1 + R( syl.height - rand_y )\n	else\n		dx1 = fx.pos_l + rand_x\n		dy1 = fx.pos_t + syl.height * R( 0, 1 )\n		dx2 = dx1 + R( syl.width - rand_x )\n		dy2 = dy1\n	end\n	if j < maxj then\n		time_ini = R( delay, 2 * delay )\n		retime( \"preline\", delay2 - time_ini, delay2 - time_ini + delay )\n		return format( \"\\\\clip(%s,%s,%s,%s)\\\\t(\\\\clip(%s,%s,%s,%s))\\\\1c( %s )\\\\fad(120,0)\",\n			dx1, dy1, dx2, dy2, fx.pos_l - 4r, fx.pos_t, fx.pos_r + 4r, fx.pos_b, colors[ j ]\n		)\n	end\n	retime( \"preline\", delay2 - R( delay, 2 * delay ), syl.start_time )\n	return format( \"\\\\clip(%s,%s,%s,%s)\\\\t(0,%s,\\\\clip(%s,%s,%s,%s))\\\\fad(120,0)\",\n		dx1, dy1, dx2, dy2, delay, fx.pos_l - 4r, fx.pos_t, fx.pos_r + 4r, fx.pos_b\n	)\nend", "Lua", false, false )
