	Clip_Circles_LI = effector.create_fx( "TLfx", "Clip_Circles_LI", "Translation Line", true, false, "#FFFFFF", "#848484", "#454545", "0", "0", "0", "l.start_time", "l.end_time", "", "", "", "", "line.center", "line.middle", "", "", "5", "0", "fx.pos_x", "fx.pos_y", "", "1", "", "line.text_stripped", "circles( )", "circles = function( )\n	local coor_x, coor_y, radius, Shapes\n	local max_loop = 8\n	if j == 1 then\n		coor_x = remember( \"coorx\", { [ 0 ] = 0 } )\n		coor_y = remember( \"coory\", { } )\n		radius = remember( \"Radius\", { } )\n		Shapes = remember( \"Shps\", { } )\n		local i, k = 0, 1\n		while coor_x[ i ] < l.width + l.height do\n			coor_x[ i + 1 ] = coor_x[ i ] + R( 0.6 * l.height, 1.0 * l.height )\n			i = i + 1\n		end\n		for i, v in pairs( coor_x ) do\n			coor_y[ i ] = Rs( 0, 0.4 * l.height )\n		end\n		while coor_x[ k ] do\n			radius[ k ] = math.distance( coor_x[ k - 1 ], coor_y[ k - 1 ], coor_x[ k ], coor_y[ k ] )\n			k = k + 1\n		end\n		for i = 1, max_loop do\n			Shapes[ i ] = \"\"\n			for k = 1, #radius do\n				Shapes[ i ] = Shapes[ i ] .. shape.displace(\n					shape.size( shape.circle, 8 + (2 * radius[ k ] - 8) * (i - 1) / (max_loop - 1) ),\n					coor_x[ k - 1 ], coor_y[ k - 1 ], \"center\"\n				)\n			end\n		end\n	else\n		coor_x = recall.coorx\n		coor_y = recall.coory\n		radius = recall.Radius\n		Shapes = recall.Shps\n	end\n	local delay = max_loop * 2f\n	replay( 2 )\n	if J == 1 then\n		maxloop( max_loop )\n		retime( \"preline\", delay * (j - 1) / maxj, delay * j / maxj )\n		return format( \"\\\\clip(%s)\", shape.displace( Shapes[ j ], l.center, l.middle, \"center\" ) )\n	end\n	retime( \"line\", delay, 0 )\n	return \"\"\nend", "Lua", false )
	Clip_Curves_LI = effector.create_fx( "TLfx", "Clip_Curves_LI", "Translation Line", true, false, "#FFFFFF", "#848484", "#454545", "0", "0", "0", "l.start_time", "l.end_time", "", "", "", "", "line.center", "line.middle", "", "", "5", "0", "fx.pos_x", "fx.pos_y", "", "1", "", "line.text_stripped", "curves( )", "curves = function( )\n	local function curves2( )\n		local Shape, Shapes, mod = format( \"m 0 %s \", l.height ), { }, { }\n		mod[ 1 ] = format( \"b %s %s %s 0 %s 0 \", l.height / 2, l.height, l.height / 2, l.height )\n		mod[ 2 ] = format( \"b %s 0 %s %s %s %s \", l.height / 2, l.height / 2, l.height, l.height, l.height )\n		local Shape_width = 0\n		local i = 0\n		while Shape_width < l.width + l.height do\n			Shape = Shape .. shape.displace( mod[ i%2 + 1 ], i * l.height, 0 )\n			Shape_width = Shape_width + l.height\n			i = i + 1\n		end\n		Shapes[ 1 ] = Shape .. format( \"l %s 0 l 0 0 l 0 %s \", shape.width( Shape ), l.height )\n		Shapes[ 2 ] = Shape .. format( \"l %s %s l 0 %s \", shape.width( Shape ), l.height, l.height )\n		return Shapes[ 1 ], Shapes[ 2 ]\n	end\n	local delay = 8f\n	replay( 2 )\n	if J == 1 then\n		maxloop( 8 )\n		retime( \"preline\", delay * (j - 1) / maxj, delay * j / maxj )\n		local shape_1, shape_2 = curves2( )\n		local Shape = shape_1 .. shape.displace( shape_2, 0, 1.45 * l.height * (1 - module) )\n		return format( \"\\\\clip(%s)\", shape.displace( Shape, l.center, l.middle, \"center\" ) )\n	end\n	retime( \"line\", delay, 0 )\n	return \"\"\nend", "Lua", false )
	Clip_Curves_LI_and_LO = effector.create_fx( "TLfx", "Clip_Curves_LI_and_LO", "Translation Line", true, false, "#FFFFFF", "#848484", "#454545", "0", "0", "0", "l.start_time", "l.end_time", "", "", "", "", "line.center", "line.middle", "", "", "5", "0", "fx.pos_x", "fx.pos_y", "", "1", "", "line.text_stripped", "curves( )", "curves = function( )\n	local function curves2( )\n		local Shape, Shapes, mod = format( \"m 0 %s \", l.height ), { }, { }\n		mod[ 1 ] = format( \"b %s %s %s 0 %s 0 \", l.height / 2, l.height, l.height / 2, l.height )\n		mod[ 2 ] = format( \"b %s 0 %s %s %s %s \", l.height / 2, l.height / 2, l.height, l.height, l.height )\n		local Shape_width = 0\n		local i = 0\n		while Shape_width < l.width + l.height do\n			Shape = Shape .. shape.displace( mod[ i%2 + 1 ], i * l.height, 0 )\n			Shape_width = Shape_width + l.height\n			i = i + 1\n		end\n		Shapes[ 1 ] = Shape .. format( \"l %s 0 l 0 0 l 0 %s \", shape.width( Shape ), l.height )\n		Shapes[ 2 ] = Shape .. format( \"l %s %s l 0 %s \", shape.width( Shape ), l.height, l.height )\n		return Shapes[ 1 ], Shapes[ 2 ]\n	end\n	local delay = 8f\n	local shape_1, shape_2 = curves2( )\n	replay( 3 )\n	if J == 1 then\n		maxloop( 8 )\n		retime( \"preline\", delay * (j - 1) / maxj, delay * j / maxj )\n		local Shape = shape_1 .. shape.displace( shape_2, 0, 1.45 * l.height * (1 - module) )\n		return format( \"\\\\clip(%s)\", shape.displace( Shape, l.center, l.middle, \"center\" ) )\n	elseif J == 2 then\n		maxloop( 8 )\n		retime( \"postline\", - delay + delay * (j - 1) / maxj, - delay + delay * j / maxj )\n		local Shape = shape_1 .. shape.displace( shape_2, 0, 1.2m * l.height )\n		return format( \"\\\\clip(%s)\", shape.displace( Shape, l.center, l.middle, \"center\" ) )\n	end\n	retime( \"line\", delay, -delay )\n	return \"\"\nend", "Lua", false )
