	Clip_Randoms_LI = effector.create_fx( "TLfx", "Clip_Randoms_LI", "Translation Line", true, false, "#FFFFFF", "#848484", "#454545", "0", "0", "0", "l.start_time", "l.end_time", "", "", "", "", "line.center", "line.middle", "", "", "5", "0", "fx.pos_x", "fx.pos_y", "", "1", "", "line.text_stripped", "randoms( )", "randoms = function( )\n	local function randoms2( )\n		local Shape = format( \"m 0 %s \", R( l.height ) )\n		local Shape_width = 0\n		local i, widthx = 0, 0\n		local Shapes\n		if j == 1 then\n			Shapes = remember( \"shps\", { } )\n			while Shape_width < l.width + l.height do\n				widthx = R( l.height )\n				Shape = Shape .. format( \"l %s %s \", Shape_width + widthx, R( l.height ) )\n				Shape_width = Shape_width + widthx\n				i = i + 1\n			end\n			Shapes[ 1 ] = Shape .. format( \"l %s 0 l 0 0 l 0 %s \", shape.width( Shape ), l.height )\n			Shapes[ 2 ] = Shape .. format( \"l %s %s l 0 %s \", shape.width( Shape ), l.height, l.height )\n		else\n			Shapes = recall.shps\n		end\n		return Shapes[ 1 ], Shapes[ 2 ]\n	end\n	local delay = 8f\n	replay( 2 )\n	if J == 1 then\n		maxloop( 8 )\n		retime( \"preline\", delay * (j - 1) / maxj, delay * j / maxj )\n		local shape_1, shape_2 = randoms2( )\n		local Shape = shape_1 .. shape.displace( shape_2, 0, 1.2 * l.height * (1 - module) )\n		return format( \"\\\\clip(%s)\", shape.displace( Shape, l.center, l.middle, \"center\" ) )\n	end\n	retime( \"line\", delay, 0 )\n	return \"\"\nend", "Lua", false )
