	ABC_Create_New_fx = effector.create_fx( "FTfx", "ABC_Create_New_fx", "Syl", true, false, "#FFFFFF", "#848484", "#454545", "0", "0", "0", "l.start_time", "l.end_time", "", "", "", "", "syl.center", "syl.middle", "", "", "5", "0", "fx.pos_x", "fx.pos_y", "", "1", "", "syl.text", "", "", "Lua", false, false )
	function_color_ass = effector.create_fx( "FTfx", "function_color_ass", "Syl", true, false, "#FADE22", "#057ECF", "#FD0A03", "0", "0", "0", "l.start_time", "l.end_time", "", "", "", "", "syl.center", "syl.middle", "", "", "5", "0", "fx.pos_x", "fx.pos_y", "", "1", "", "syl.text", "format( \"\\\\1c%s\", color.ass( \"#FF0000\" ) )", "hint = \"Esta función convierte un color de formato HTML a formato ASS, aunque ya no es necesaria usarla ya que está integrada en el KE y el cambio de formato se hace de manera automática\"", "Lua", false )
	function_color_interpolate = effector.create_fx( "FTfx", "function_color_interpolate", "Syl", true, false, "#4A4A4A", "#FFFFFF", "#6A8DD6", "0", "0", "0", "l.start_time", "l.end_time", "", "", "", "", "syl.center", "syl.middle", "", "", "5", "0", "fx.pos_x", "fx.pos_y", "", "1", "", "syl.text", "\"\\\\1c\" .. color.interpolate( 1m1, \"&HFF0000&\", \"&H0000FF&\" )", "hint = \"Esta función retorna la interpolación entre dos colores. Los dos primeros Argumentos pueden ser colores o tablas de colores. El tercer Argumento es 0.5 por default, y hace referencia a un número entre 0 y 1, y decide la tendencia del color retornado.\"", "Lua", false )
	function_color_set = effector.create_fx( "FTfx", "function_color_set", "Syl", true, false, "#4A4A4A", "#FFFFFF", "#6A8DD6", "0", "0", "0", "l.start_time", "l.end_time", "", "", "", "", "syl.center", "syl.middle", "", "", "5", "0", "fx.pos_x", "fx.pos_y", "", "1", "", "syl.text", "color.set( times, colors, \"\\\\1c\" )", "mi_gradient = table.ipol( { \"&H0077FF&\", \"&H0ADA50&\" }, syl.n );\ntimes = { \"0:00:06.066\", \"0:00:08.300\", \"0:00:10.535\", \"0:00:14.306\", \"0:00:20.200\", { \"0:00:30.116\", 1000 }, \"0:00:43.066\" };\ncolors = { \"&HB82AFB&\", \"&HFB7E35&\", mi_gradient, \"&HB82AFB&\", \"&H44AAFA&\", \"&HFB7E35&\", \"&HB82AFB&\" }", "Lua", false )
	function_shape_array = effector.create_fx( "FTfx", "function_shape_array", "Line", true, false, "#FFFFFF", "#ADC4D6", "#6A8DD6", "0", "0", "0", "l.start_time", "l.end_time", "", "", "", "", "line.center", "line.middle", "", "", "5", "0", "xres / 2", "yres / 2", "", "1", "", "shape_array[ 12 ]", "\"\\\\bs0\"", "Shapes = {\n	[ 1 ] = shape.size( shape.shine1t, 32 ),	-->Ver la función shape.size\n	[ 2 ] = shape.size( shape.rectangle, 24 )\n};\nshape_array = {\n	[ 1 ] = shape.array( Shapes[ 1 ], 12 ),	-->Hace un arreglo horizontal de 12 repeticiones de la Shape (ángulo = 0°)\n	[ 2 ] = shape.array( Shapes[ 1 ], 7, 45 ),	-->Hace un arreglo de 7 Shapes, con un ángulo de 45° (45° = pi/4)\n	[ 3 ] = shape.array( Shapes[ 2 ], 5, 90, 10 ),	-->Hace un arreglo de 5 shapes, con un ángulo de 90° y con una separación entre ellas de 10px\n	[ 4 ] = shape.array( Shapes[ 2 ], 5, { 10, 30 }, 10 ), -->Parecido al caso anterior, pero ahora se le agrega una rotación de 30° a las Shapes\n	[ 5 ] = shape.array( Shapes[ 2 ], { 5, 4 }, \"array\", { 10, 5 } ), -->Arreglo rectangular de 5x4, separados 10px a lo Ancho y 5px a lo Alto\n	[ 6 ] = shape.array( Shapes, { 5, 4 }, \"array\", { 10, 5 } ), -->Arreglo rectangular de 5x4 usando las Shapes de la table ingresada\n	[ 7 ] = shape.array( Shapes[ 2 ] , 8, \"radial\", 50 ), -->Arreglo radial de 8 Shapes con un Radio interior de 50px\n	[ 8 ] = shape.array( Shapes[ 2 ] , 8, \"radial\", { 50, 80 } ), -->Arreglo radial de 8 Shapes, con un Radio inicial de 50px y Radio final de 80px\n	[ 9 ] = shape.array( Shapes[ 2 ] , 8, \"radial\", { 60, 100, 120 } ), -->Radio inicial de 60px, Radio final de 100px y un Arco de 120°\n	[ 10 ] = shape.array( Shapes[ 2 ] , 8, \"radial\", { 60, 60, 150, 90 } ), -->Radio inicial y final de 60px, un Arco de 150° partiendo desde 90°\n	[ 11 ] = shape.array( Shapes[ 2 ] , { 6, 3 }, \"radial\", 64 ), -->Arreglo radial de 6 Shapes, repetido 3 veces, a una distancia de 0px entre sí\n	[ 12 ] = shape.array( Shapes[ 2 ] , { 6, 3 }, \"radial\", { 64, 10 } ), -->Las 3 repeticiones están separadas 10px entre sí\n	[ 13 ] = shape.array( Shapes , { 8, 3 }, \"radial\", { 64, 10 } ), -->Se alternan las Shapes de la tabla ingresada\n}", "Lua", false )
	function_shape_displace = effector.create_fx( "FTfx", "function_shape_displace", "Line", true, false, "#FFFFFF", "#ADC4D6", "#6A8DD6", "0", "0", "0", "l.start_time", "l.end_time", "", "", "", "", "line.center", "line.middle", "", "", "5", "0", "fx.pos_x", "fx.pos_y", "", "1", "", "shape.displace( shape.rectangle, -20, 45 )", "", "Hint = \"Esta función desplaza la Shape ingresada en el plano del ASSDraw3 la cantidad de pixeles en el plano que le indiquemos. El segundo Argumento indica el desplacemiento horizontal, y el tercero el vertical. Ambos valores por Default son 0\"", "Lua", false )
	function_shape_filter = effector.create_fx( "FTfx", "function_shape_filter", "Line", true, false, "#FFFFFF", "#ADC4D6", "#6A8DD6", "0", "0", "0", "l.start_time", "l.end_time", "", "", "", "", "line.center", "line.middle", "", "", "5", "0", "fx.pos_x", "fx.pos_y", "", "1", "", "shape.filter( shape.rectangle, 2, my_filter1, my_filter2 )", "\"\\\\bs0\"", "my_filter1 = function( x, y )\n	x = math.polar( Ao + 30, Do, \"x\" )\n	y = math.polar( Ao + 30, Do, \"y\" )\n	return x, y\nend;\nmy_filter2 = function( x, y )\n	x = x\n	y = y + 12 * sin( 4 * pi * My )\n	return x, y\nend;\nHint = \"shape.filter( Shape, Split, ... ) --> Modifica los puntos de la Shape ingresada por medio de uno o más filtros\"", "Lua", false )
	function_shape_height = effector.create_fx( "FTfx", "function_shape_height", "Line", true, false, "#FFFFFF", "#ADC4D6", "#6A8DD6", "0", "0", "0", "l.start_time", "l.end_time", "", "", "", "", "line.center", "line.middle", "", "", "5", "0", "fx.pos_x", "fx.pos_y", "", "1", "", "shape.height( shape.circle )", "", "hint = \"Esta función retorna el alto total medido en pixeles de la shape ingresada.\"", "Lua", false )
	function_shape_info = effector.create_fx( "FTfx", "function_shape_info", "Line", true, false, "#FFFFFF", "#ADC4D6", "#6A8DD6", "0", "0", "0", "l.start_time", "l.end_time", "", "", "", "", "line.center", "line.middle", "", "", "5", "0", "fx.pos_x", "fx.pos_y", "", "1", "", "table.view( shape_info, \"info_from_shape\" )", "", "shape.info( shape.circle );\nshape_info = {\n	[ 1 ] = minx,	--> la menor de las coordenadas en \"x\"\n	[ 2 ] = maxx,	--> la mayor de las coordenadas en \"x\"\n	[ 3 ] = miny,	--> la menor de las coordenadas en \"y\"\n	[ 4 ] = maxy,	--> la mayor de las coordenadas en \"y\"\n	[ 5 ] = w_shape,	--> (width) ancho total en pixeles de la shape\n	[ 6 ] = h_shape,	--> (height) alto total en pixeles de la shape\n	[ 7 ] = c_shape,	--> (center) coordenada en \"x\" del centro de la shape\n	[ 8 ] = m_shape,	--> (middle) coordenada en \"y\" del centro de la shape\n	[ 9 ] = n_points,	--> cantidad de puntos de la shape\n};\nHint = \"Esta función nos permite usar 9 valores concernientes a la Shape ingresada. Los nombre de las 9 variables están consignados en la anterior table de valores\"", "Lua", false )
	function_shape_length = effector.create_fx( "FTfx", "function_shape_length", "Line", true, false, "#FFFFFF", "#ADC4D6", "#6A8DD6", "0", "0", "0", "l.start_time", "l.end_time", "", "", "", "", "line.center", "line.middle", "", "", "5", "0", "fx.pos_x", "fx.pos_y", "", "1", "", "shape.length( shape.circle )", "", "hint = \"Esta función retorna la longitud total del Perímetro de la shape ingresada.\"", "Lua", false )
	function_shape_lmove = effector.create_fx( "FTfx", "function_shape_lmove", "Line", true, false, "#FFFFFF", "#ADC4D6", "#6A8DD6", "0", "0", "0", "l.start_time", "l.end_time", "", "", "", "", "line.center", "line.middle", "", "", "5", "0", "fx.pos_x", "fx.pos_y", "", "1", "", "line.text_stripped", "lmoves2[ 2 ]", "lmoves2 = {\n	[ 1 ] = shape.lmove( { -l.width/2, fx.pos_y, fx.pos_x, fx.pos_y, xres + l.width/2, fx.pos_y }, { 0, 200, fx.dur - 200, fx.dur } ),\n	[ 2 ] = shape.lmove( { -l.width/2, fx.pos_y, fx.pos_x, fx.pos_y - 150, fx.pos_x, fx.pos_y, xres + l.width/2, fx.pos_y }, nil, { 0, fx.dur - 200 } )\n};\nHint = \"Esta función desplaza el objeto karaoke de manera lineal entre todos los puntos que ingresemos. La opción 1 de la tabla anterior permite que seleccionemos los tiempos de cada movimiento entre cada uno de los puntos, y en la opción 2 solo colocamos los tiempos de inicio y final, y la función ejecuta todos lo movimientos dentro de ese rango de tiempo seleccionado\"", "Lua", false )
	function_shape_oblique = effector.create_fx( "FTfx", "function_shape_oblique", "Line", true, false, "#FFFFFF", "#343434", "#000000", "0", "0", "0", "l.start_time", "l.end_time", "", "", "", "", "line.center", "line.middle", "", "", "5", "0", "fx.pos_x", "fx.pos_y", "", "1", "", "shape.oblique( text.to_shape( \"86\" ), -20, \"y\" )", "", "hint = \"Esta función afila a la shape ingresada una cantidad de pixeles indicados en el segundo Argumento, y respecto al eje indicado en el tercero\"", "Lua", false )
	function_shape_ratio = effector.create_fx( "FTfx", "function_shape_ratio", "Line", true, false, "#FFFFFF", "#ADC4D6", "#6A8DD6", "0", "0", "0", "l.start_time", "l.end_time", "", "", "", "", "line.center", "line.middle", "", "", "5", "0", "fx.pos_x", "fx.pos_y", "", "1", "", "shape_ratio[ 3 ]", "", "shape_ratio = {\n	[ 1 ] = shape.ratio( shape.note1t, 1.5 ),	-->Ambas dimensiones de la Shape aumentan en un 150% su tamaño\n	[ 2 ] = shape.ratio( shape.note1t, 1.5, 0.4 ),	-->El Ancho aumenta un 150% y el Alto se reduce en un 40%\n	[ 3 ] = shape.ratio( shape.note1t, { 50 } ),	-->La Shape cambia de tamaño proporcionalmente hasta que el Ancho sea de 50px\n	[ 4 ] = shape.ratio( shape.note1t, 1, { 80 } ),	-->La Shape cambia de tamaño proporcionalmente hasta que el Alto sea de 80px\n};\nHint = \"Esta función modifica el tamaño de la Shape ingresada haciendo uso de las proporciones ingresadas en los Argumentos 2 y 3 de la misma. La proporción 1 equivale al 100% que es el tamaño de cada dmensión por Default\"", "Lua", false )
	function_shape_redraw = effector.create_fx( "FTfx", "function_shape_redraw", "Line", true, false, "#FFFFFF", "#ADC4D6", "#6A8DD6", "0", "0", "0", "l.start_time", "l.end_time", "", "", "", "", "line.center", "line.middle", "", "", "5", "0", "fx.pos_x", "fx.pos_y", "", "1", "", "shape.redraw( shape.circle, 4 )", "", "hint = \"Esta función redibuja la shape ingresada en segmentos rectos con longitud determinada. La longitud de cada segmento es de 2 px por default, o la que ingresemos en el segundo Argumento de la función\"", "Lua", false )
	function_shape_reflect = effector.create_fx( "FTfx", "function_shape_reflect", "Line", true, false, "#FFFFFF", "#343434", "#000000", "0", "0", "0", "l.start_time", "l.end_time", "", "", "", "", "line.center", "line.middle", "", "", "5", "0", "fx.pos_x", "fx.pos_y", "", "1", "", "shape.reflect( text.to_shape( \"86\" ), \"y\" )", "", "hint = \"Esta función refleja a la shape ingresada respecto al eje que le indiquemos en el segundo Argumento de la función.\"", "Lua", false )
